{ if(!layer)return 0; init(layer-1, i*2); init(layer-1, i*2+1); int j, m = 1<<layer, l = i*m, r = i*m+m/2; for(j = 0; j < m; j++) { if((MST[layer-1][l] < MST[layer-1][r] && l < i*m+m/2) || r == i*m+m) MST[layer][i*m+j] = MST[layer-1][l++]; else MST[layer][i*m+j] = MST[layer-1][r++]; }
