Segment Tree를 사용하여 아주 기본적인 부분 합 쿼리 문제 를 처리해보자. 문제를 요약하면 다음과 같다. 어떤 N개의 수가 주어져 있다. 그런데 중간에 수의 변경이 M번 일어나고 그 중간에 어떤 부분의 합을 K번 구하려 한다. \(N\leq1,000,000, M\leq10,000, K\leq10,000\) 첫째 줄에 수의 개수 N, 수의 변경이 일어나는 횟수 M,부분의 합을 구해야 하는 횟수 K가 입력된다. 그리고 둘째 줄부터 N+1번째 줄까지 N개의 수가 주어진다. N+2번째 줄부터 N+M+K+1번째 줄까지 세 개의 정수 a,b,c가 주어지는데, a가 1인 경우 b번째 수를 c로 바꾸고 a가 2인 경우에는 b번째 수부터 c번째 수까지의 합을 구하여 출력하면 된다. 간단한 구간 합 문제이므로 Segment Tree를 이용해 해결할 수 있습니다. Segment Tree를 구현할 때, 대략 2가지 방법이 있는데, 재귀함수를 이용하는 방법을 사용해보겠습니다. #include <bits/stdc++.h> using namespace std;
typedef long long int ll; ll tree[4400000]; //it is safe to have size*4
ll arr[1100000];
int N,M,K;
void init(int s,int e,int node){ if(s==e) tree[node]=arr[s]; //leaf node else{ int m=(s+e)>>1; init(s,m,node*2); init(m+1,e,node*2+1); //recursive tree[node]=tree[node*2]+tree[node*2+1]; }
}
ll range(int s,int e,int node,int l,int r){//l~r if(e<l||r<s) return 0;//not in range if(l<=s&&e<=r) return tree[node]; // node range inside l~r int m=(s+e)>>1; return range(s,m,node*2,l,r)+range(m+1,e,node*2+1,l,r); //calls its leaf
}
void update(int s,int e,int node,int pos,int val){ if(pos<s||e<pos) return ; if(s==e){ tree[node]=val; return ; } int m=(s+e)>>1; update(s,m,node*2,pos,val); update(m+1,e,node*2+1,pos,val); tree[node]=tree[node*2]+tree[node*2+1];//update its value
} int main(){ scanf("%d %d %d",&N,&M,&K); for(int i=1;i<=N;i++){ scanf("%lld",&arr[i]); } init(1,N,1); for(int i=0;i<M+K;i++){ int a,b,c; scanf("%d %d %d",&a,&b,&c); if(a==1){ update(1,N,1,b,c); } else{ printf("%lld\n",range(1,N,1,b,c)); } } return 0;
} tree의 크기는 그 트리가 담당하는 구간의 4배 정도로 하면 안전합니다. s,e는 그 트리가 담당하는 구간이고 node는 그 트리의 번호입니다. tree의 왼쪽 자식을 나타낼 때에는 (원래 번호)*2를 해주고, 오른쪽 자식을 나타낼 때에는 (원래 번호)*2+1을 해 주어 노드 번호를 변화시킵니다. update나 range의 특징은 범위에 자신이 해당되지 않거나 완벽히 해당되면 바로 return 한다는 것입니다. 이 특징 때문에 쿼리당 시간 복잡도는 \(O(\log N)\)입니다.

