다익스트라 알고리즘의 실제 구현 방법을 봅시다. 위의 설명 그대로 단순하게 구현한 프로그램은 \(O(|E||V|)\)의 시간에 동작하지만, 우선순위 큐를 이용하면 \(O(|E|\log |V|)\)의 시간에 동작하도록 할 수 있습니다. cost[]배열을 이용하는 대신 우선순위 큐를 사용해 최솟값을 관리하는 것이죠. 최단거리 업데이트 과정에서 모든 간선은 한 번씩만 사용되므로 우선순위 큐에 각 우선순위 큐에는 최대 총 \(|E|\)번의 삽입/삭제 연산이 일어나게 됩니다. 이에 의한 시간 복잡도는 \(O(|E|\log |E|)\)이고, \(|E|\)는 \(|V|^2\)보다 작으므로 이는 \(O(|E|\log |V|)\)라고 할 수 있습니다. 아래 코드의 dijkstra() 함수는 STL의 priority_queue 자료구조를 사용하여 Dijkstra 알고리즘을 구현하는 예시입니다. pair<int, int>자료형의 first값은 거리, second값은 노드 번호입니다. pair자료형에서 크기 비교 기준은 first값이므로, 우선순위 큐는 자동적으로 거리에 대한 오름차순으로 정렬되게 됩니다. 이미 방문한 정점 검사는 현재 원소의 second값, 즉 거리 값이 dist[(현재 원소의 first값)]보다 크거나 같은지를 이용하면 쉽게 가능합니다. 이미 방문한 정점이라면 dist값이 최단거리 값으로 업데이트되어 있기 때문에 dist값보다 더 작은 거리값은 나올 수 없기 때문이죠. #include<bits/stdc++.h>
#define V 100000 //maximum number of nodes using namespace std;
typedef pair<int, int> pp; int dist[V]; vector<pp> d[V]; //first=weight, second=node number
priority_queue<pp, vector<pp>, greater<pp> > cost; //first=distance, second=node number void dijkstra(int v){ int i, j; pp t; for(i=0;i<v;i++) dist[i]=INT_MAX; cost.push(pp(0, 0)); for(i=0;i<v;i++){ while(cost.top().first>=dist[cost.top().second]) cost.pop(); //delete already visited nodes t=cost.top(), cost.pop(); dist[t.second]=t.first; for(j=0;j<d[t.second].size();j++){ cost.push(pp(dist[t.second]+d[t.second][j].first, d[t.second][j].second)); } }
}

